CREATE TABLE category (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  image BLOB NOT NULL,
  information TEXT,
  name TEXT NOT NULL
);

CREATE TABLE memes (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  image BLOB NOT NULL,
  caption TEXT,
  locationlat TEXT,
  locationlon TEXT,
  username TEXT NOT NULL,
  timestamp TEXT,
  catid INTEGER NOT NULL,
  FOREIGN KEY (catid) REFERENCES category(id)
);

